import React from 'react';

// JSX Components
import Header from './Header';
import Footer from './Footer';

function App() {
  return (
    <div>
      <Header />
      <img src="https://m.media-amazon.com/images/M/MV5BMDdmZGU3NDQtY2E5My00ZTliLWIzOTUtMTY4ZGI1YjdiNjk3XkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg" alt="Braveheart"></img>
      <Footer />
    </div>
  );
}

export default App;
